INSERT INTO `events` (`EventID`, `EventName`, `EventDate`, `EventTime`, `Tickets`, `Location`, `Description`, `EventPoster`, `Organizer`) VALUES
(3, 'KAIRAT NURTAS ', '2024-01-12', '19:30:00', 95, 'Дворец Республики', 'Любимец миллионов поклонников и один из самых богатых певцов казахстанского шоу-бизнеса Кайрат Нуртас начал свой путь к славе в детстве. Его творческие достижения не ограничиваются музыкой. Талантливый исполнитель добился успеха и в других сферах жизни – кино, издательском деле и даже производстве одежды.', , 'isco');
INSERT INTO `events` (`EventID`, `EventName`, `EventDate`, `EventTime`, `Tickets`, `Location`, `Description`, `EventPoster`, `Organizer`) VALUES
(18, '«Magical жетіген» в Алматы', '2024-01-21', '19:30:00', 100, 'Алматы қ., Нұркент шағынауданы, 6, Алатау дәстүрлі өнер театры', 'Қазақ халқының көне жетіген аспабын насихаттаушы Тұрсынай Әлібекқызының заманауи «Magical Zhetigen» атты сиқырлы әуенге толы лирикалық кешіне шақырамыз. Кеште жетіген аспабынан әлемнің хит әндерін сондай-ақ жетіген мен электро-гитара аспаптарымен коллабарациясын тыңдай аласыз.\r\n\r\nЖетіген аспабының заманауи сиқырға толы үні сізді бей-жай қалдырмайтыны анық.', , 'isco');
INSERT INTO `events` (`EventID`, `EventName`, `EventDate`, `EventTime`, `Tickets`, `Location`, `Description`, `EventPoster`, `Organizer`) VALUES
(19, 'Бағжан Октябрь с концертной программой «Терапия души» в Астане', '2023-12-21', '20:00:00', 145, ' г. Астана, ЦКЗ «QAZAQSTAN»', 'Один из самых узнаваемых виолончелистов Бағжан Октябрь выступит с обновленной программой «Терапия Души» в сопровождении камерного оркестра. \r\n«Терапия души» - это проникновенные и чувственные звуки виолончели.', , 'isco');
INSERT INTO `events` (`EventID`, `EventName`, `EventDate`, `EventTime`, `Tickets`, `Location`, `Description`, `EventPoster`, `Organizer`) VALUES
(20, 'Еркеш Шакеев - Anticoncert #1 в Алматы', '2024-01-19', '19:30:00', 95, 'г. Алматы, проспект Абая 117, Театр «Жас Сахна»', '«ANTICONCERT №1» - ЕРКЕШ ШАКЕЕВ\r\n\r\nНОВЫЙ ФОРМАТ - ПРЕМЬЕРЫ & МЕГАХИТЫ - ПОЁМ ПЕСНИ С АВТОРОМ Еркеш Шакеев: «… при участии группы Q’BAND, в первой части прозвучат новые песни из альбома «Меню Счастья» - Белое Облако, Шторы, Я Люблю Тебя, Меню Счастья, а также премьеры, написанные совсем недавно…', , 'isco');
INSERT INTO `events` (`EventID`, `EventName`, `EventDate`, `EventTime`, `Tickets`, `Location`, `Description`, `EventPoster`, `Organizer`) VALUES
(21, 'Богдан Лисевский в Алматы', '2024-02-03', '18:00:00', 100, 'г. Алматы, Бакшасарай', 'Комик с оригинальной манерой подачи материала. Игра слов, неожиданные заходы и многоуровневые шутки с непредсказуемой развязкой стали частью своеобразного стиля Лисевского.', , 'isco');
INSERT INTO `events` (`EventID`, `EventName`, `EventDate`, `EventTime`, `Tickets`, `Location`, `Description`, `EventPoster`, `Organizer`) VALUES
(22, 'The world of Hans Zimmer в Усть-Каменогорске', '2024-02-08', '18:30:00', 100, ' г. Усть-Каменогорск, ул. Протозанова, №43, Концертный зал «Ертіс концерт»', 'Tynda.music представит новую программу музыки великого кинокомпозитора Ханса Циммера в исполнении симфонического оркестра и хора.\r\n\r\nХанс Циммер немецкий кинокомпозитор, широко известный своей музыкой к фильмам. Циммер признан одним из наиболее инновационных композиторов в киноиндустрии. Его работы примечательны тем, что они сочетают звуки электронной музыки с традиционными оркестровыми аранжировками.', , 'isco');

